import React from "react";
import "../Grade.css";
import PropTypes from "prop-types";
import {Link} from "react-router-dom";

const SubGradeModal = ({ modalIsOpen, openModal }) => {
  return (
    <div>
      {modalIsOpen ? (
        <div className="modal_wrapper">
          <div className="modal_container">
            <div className="modal_form">
              <div className="modal_close_button" onClick={() => openModal()}>
                X
              </div>
              <div className="modal_subGrade_title">Изберете клас</div>
              <div className="modal_subGrade_content">
                <table>
                  <tbody>
                    <tr >
                      <Link className="modal_subGrade_grade">
                        <td className="modal_subGrade_grade">8 б</td>
                        <td>Тодорка Иванова</td>
                      </Link>
                    </tr>
                  </tbody>
                  </table>
              </div>
            </div>
          </div>
        </div>
      ) : null}
    </div>
  );
};

SubGradeModal.propTypes = {};

export default SubGradeModal;
